def generate_numbers(N):
    if N <= 0:
        return []
    elif N > 100:
        print('N should be less than or equal to 100.')
        return []
    numbers = []
    for i in range(N):
        num = (110 * i + N) % 101
        numbers.append(num)
    n = len(numbers)
    for i in range(n):
        for j in range(0, n - i - 1):
            if numbers[j] > numbers[j + 1]:
                (numbers[j], numbers[j + 1]) = (numbers[j + 1], numbers[j])
    return numbers

